import React from 'react';
import './style.css'
import { Link } from 'react-router-dom';

const Contato = () => {
    return(
        <div class="">
            <h1>Teste Contato</h1>
            <Link to="/">Retornar Para Home</Link>
        </div>
    );
}

export default Contato;
